import React, { Component } from 'react'
import './footer.css'
import { Row, Col } from 'antd'


class Footer extends Component {
    render() {
        return (
            <div className="footer">
                <Row>
                    <Col span={6}>

                    </Col>
                    <Col span={6}>2</Col>
                    <Col span={6}>3</Col>
                    <Col span={6}>4</Col>
                </Row>
            </div>
        )
    }
}

export default Footer;
